import logo from './logo.svg';
import { createMuiTheme, ThemeProvider, makeStyles } from '@material-ui/core/styles';
import NavBar from './components/NavBar'
import Grid from './components/Grid'
import './App.css';


import SecurityIcon from '@material-ui/icons/Security';
import EventNoteIcon from '@material-ui/icons/EventNote';
import TrendingUpIcon from '@material-ui/icons/TrendingUp';
import ImportExportIcon from '@material-ui/icons/ImportExport';
import ComputerIcon from '@material-ui/icons/Computer';
import HttpIcon from '@material-ui/icons/Http';



const theme = createMuiTheme({
  palette: {
    primary: {
      main:"#2e1667",
    },
    secondary: {
      main:"#c7d8ed",
    },
  },
  typography: {
    fontFamily: [
      'Roboto'
    ],
    h4: {
      fontWeight: 600,
      fontSize: 28,
      lineHeight: '2rem',
      },
    h5: {
      fontWeight: 100,
      lineHeight: '2rem',
    },
  },
});

const styles = makeStyles({
  wrapper: {
    width: "65%",
    margin: "auto",
    textAlign: "center"
  },
  bigSpace:{
    marginTop: "5rem"
  },
  littleSpace:{
    marginTop:"2.5rem",
  },
  grid:{
    display:"flex",
    justifyContent:"center",
    alignItems:"center",
    flexWrap:"wrap",
  },
})

function App() {
  const classes = styles();
  return (
    <div className="App">
      <ThemeProvider theme={theme}>
        <NavBar/>
        <Grid icon={<SecurityIcon style={{fill:"EB2C27",height:"125",width:"125"}}/>} title="Aluminum Prices" btnTitle="Show me More"  />
        <Grid icon={<SecurityIcon style={{fill:"178C86",height:"125",width:"125"}}/>} title="Stainless Steel Prices" btnTitle="Show me More"/>
        <Grid icon={<SecurityIcon style={{fill:"1A323B",height:"125",width:"125"}}/>} title="Steel Prices " btnTitle="Show me More" />
      </ThemeProvider>

    </div>

  );
}

export default App;
